import './Project.css';
const Navbar = () => {
    return (
     <div>
           <nav class="navbar navbar-expand-lg navbar-light bg-light navbar-fixed-top">


     <img src="https://d3i4yxtzktqr9n.cloudfront.net/web-eats-v2/f8f0721f871b3704cce92eb96bc6e504.svg" ml-5></img>
     <button type="button" class="btn btn-light buttonSignin">Sign In</button>
     </nav>
    </div>
    );
  };

  export default Navbar;
